import Card from '../UI/Card';

const AddUser = props => {
    return(
        <Card>
            <form>
                <label for="username">Username</label>
                <input id="username" type="text"></input>
                <label for="age">Age (Years)</label>
                <input id="age" type="text"></input>
            </form>
        </Card>
    )
}

export default AddUser;
